public class InnerAnomalyDetectorFileFormatDescriptorFactory(Action<Humidifier.LookoutMetrics.AnomalyDetectorTypes.FileFormatDescriptor> factoryAction = null) : SubResourceFactory<Humidifier.LookoutMetrics.AnomalyDetectorTypes.FileFormatDescriptor>
{

    internal InnerAnomalyDetectorJsonFormatDescriptorFactory JsonFormatDescriptorFactory { get; set; }

    internal InnerAnomalyDetectorCsvFormatDescriptorFactory CsvFormatDescriptorFactory { get; set; }

    protected override Humidifier.LookoutMetrics.AnomalyDetectorTypes.FileFormatDescriptor Create()
    {
        var fileFormatDescriptorResult = CreateFileFormatDescriptor();
        factoryAction?.Invoke(fileFormatDescriptorResult);

        return fileFormatDescriptorResult;
    }

    private Humidifier.LookoutMetrics.AnomalyDetectorTypes.FileFormatDescriptor CreateFileFormatDescriptor()
    {
        var fileFormatDescriptorResult = new Humidifier.LookoutMetrics.AnomalyDetectorTypes.FileFormatDescriptor();

        return fileFormatDescriptorResult;
    }
    public override void CreateChildren(Humidifier.LookoutMetrics.AnomalyDetectorTypes.FileFormatDescriptor result)
    {
        base.CreateChildren(result);

        result.JsonFormatDescriptor ??= JsonFormatDescriptorFactory?.Build();
        result.CsvFormatDescriptor ??= CsvFormatDescriptorFactory?.Build();
    }

} // End Of Class

